Everyday is a beautiful day for dirtbikes! 🙌🏼

@ussprintenduro prep is always my favourite because who doesn’t love some wide open grass fields 😝! 

#TaylaMFJones #TMFJ #dirtbikelife #sprintenduro #wideopen

@taylajones713 recently joined the USMCA! Get to know more about her! 

“Hey, my name is Tayla Jones, and I have been racing dirt bikes in all disciplines for over 20 years. In my career, I have won 6x ISDE world titles, 13 AMA titles, and over 10 Australian titles. I love being able to share my expertise with others, from the very beginners just starting on their first bike all the way up to the pro-level athletes looking to take it all the way to the top. Over my years in this incredible sport, I have learned from many different coaches and have combined the best of it all to bring to my riders to see them reach their goals on the bike. Safety is very important to me; being able to control the bike confidently and correctly is critical to keeping the rider safe, and I want to teach that to everyone.”

Connect with Tayla and @buildingchampionsacademy on the Motorcycle Coaching app! 📲

