Well it is not the post I want to be making only 4 days in but my time racing this years @fim_isde came to an end early. In the final test of day 3 I had a gnarly crash dislocating my shoulder and causing some damage. I lined up this morning but after the first transfer I knew there was no way it would hold up and would cause more crashes. I’m bummed to not be able to finish alongside my amazing teammates but I am super proud of how awesome they’re both doing!! 

I’ll know more news soon on the shoulder damage but for now I’ll be cheering on the Aussie girls to the finish line 🇦🇺🦘

