Best teammates and team in Argentina! So stoked for @missjessgardiner and @danielle_261_ for absolutely killing it taking 2nd 🥈 and 3rd 🥉 on the outright podium and @danielle_261_ is just 16 🤯🙌🏼. The Aussies are tough and will be ready to fight again next year 🇦🇺

Our support crew was incredible chasing us around all day everyday making sure us girls had everything we needed to do our best. These guys worked their butts off as much for us and I can’t thank them all enough. 

We would not have been able to do it without the support from everyone back home and the amazing sponsors who came on board to help get us there so a big shoutout to every single one who made this happen! #legends

